        // Fill `certificate_type`
        $this->addSql('INSERT INTO `certificate_type` VALUES (2,NULL,1,\'Справка о постановке на учет\',1,1,0,\'<b>Справка № {{ certificate.id }}</b><br/><br/>о постановке на учет\',\'{% if certificate.client %}\r\n                            <b>{{ certificate.client.fullname }}</b>,<br/>\r\n                            <span class=\"underline\">регистрационный номер клиента в базе данных:</span><br>\r\n                            № {{ certificate.client.id }}<br/><br/>\r\n                            {% if certificate.client.birthDate %}\r\n                                Дата рождения: <b>{{ certificate.client.birthDate|format_date(\\\'dd . MM . YYYY\\\') }}</b><br/>\r\n                            {% endif %}\r\n                            {% if certificate.client.birthPlace %}\r\n                                Место рождения: <b>{{ certificate.client.birthPlace }}</b>\r\n                            {% endif %}\r\n                        {% endif %}\',\'состоит на учёте как лицо без определённого места<br/>\r\n                    жительства.<br/><br/>\r\n                    {% if certificate.document %}\r\n                        Основание выдачи справки:<br>\r\n                        <b>{{ certificate.document }}</b><br/><br/>\r\n                    {% endif %}\r\n                    {% if certificate.client and certificate.client.createdAt %}\r\n                        Дата регистрации: <b>{{ certificate.client.createdAt|format_date(\\\'dd . MM . YYYY\\\') }}</b><br/>\r\n                    {% endif %}\r\n                    {% if certificate.dateFrom %}\r\n                        Дата выдачи справки: <b>{{ certificate.dateFrom|format_date(\\\'dd . MM . YYYY\\\') }}</b><br/>\r\n                    {% endif %}\r\n                    {% if certificate.dateTo %}\r\n                        Справка действует до: <b>{{ certificate.dateTo|format_date(\\\'dd . MM . YYYY\\\') }}</b><br/>\r\n                    {% endif %}\r\n                    <br><br>\r\n              